// Helper functions
function getModulByJenis(j){return MODUL_DATA.filter(m=>m.jenis===j)}
function getJabatanByNama(n){return JABATAN_DATA.find(j=>j.nama_jabatan.toLowerCase()===n.toLowerCase())}
function getPegawaiByNPP(npp){return PEGAWAI_DATA.find(p=>p.npp===npp)}
function findJabatan(keyword){const k=keyword.toLowerCase();return JABATAN_DATA.filter(j=>j.nama_jabatan.toLowerCase().includes(k))}

